import React from "react"
import style from "./Message.module.css"

const Message = (props) => {
    return (
        <div className={style.message}>
            <div><img src={props.name}/>{props.name}</div>
            <div>{props.name}</div>
            <div>{props.messages}</div>
        </div>
    )
}

export default Message
